import React from "react";

const PostList = (props) => {
  return (
    <React.Fragment>
      <thead>
        <tr>
          <th scope="col">글번호</th>
          <th scope="col">글쓴이</th>
          <th scope="col">글제목</th>
        </tr>
      </thead>
    </React.Fragment>
  );
};

export default PostList;
